import React, { useEffect }  from 'react'
import Logout from '../components/Auth/Logout';

function LogoutScreen({ setToken }) {
    useEffect(() => {
        setToken('delete');
        sessionStorage.clear();
    });

    return (
        <div className="main">
            <Logout setToken={props.setToken} />
        </div>
    )
}

export default LogoutScreen
